import React from 'react';
import { BrowserRouter as Router, Routes, Route, useLocation } from 'react-router-dom';
import Navbar from './assets/components/Navbar';
import Footer from './assets/components/Footer';
import Loader from './assets/components/Loader';

// Import page components
import Home from './assets/pages/Home/Home';
import Products from './assets/pages/Products/Products';
import Cart from './assets/pages/Cart/Cart';
import OrderHistory from './assets/pages/Orders/OrderHistory';
import OrderTracking from './assets/pages/Orders/OrderTracking';
import PaymentGateway from './assets/pages/Payment/PaymentGateway';
import Profile from './assets/pages/Profile/Profile';
import HelpDesk from './assets/pages/HelpDesk/HelpDesk';
import Login from './assets/pages/Auth/Login';
import Signup from './assets/pages/Auth/Signup';
import Dashboard from './assets/pages/Admin/Dashboard';

// Import Context Providers
import { AuthProvider } from './assets/Context/AuthContext';
import { CartProvider } from './assets/Context/CartContext';
import { OrderProvider } from './assets/Context/OrderContext';
import { NotificationProvider } from './assets/Context/NotificationContext';
import { ProductProvider } from './assets/Context/ProductContext';

// Protected Route component
const ProtectedRoute = ({ children, requireAuth = true }) => {
  // For now, we'll keep this simple
  return children;
};

const AppContent = () => {
  const location = useLocation();
  
  // Pages where we don't want to show navbar/footer
  const hideLayoutPages = ['/login', '/signup'];
  const showLayout = !hideLayoutPages.includes(location.pathname);
  
  return (
    <div className="App min-h-screen flex flex-col">
      {showLayout && <Navbar />}
      
      <main className={`flex-1 ${showLayout ? 'bg-gray-50' : ''}`}>
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<Home />} />
          <Route path="/products" element={<Products />} />
          <Route path="/help" element={<HelpDesk />} />
          
          {/* Auth Routes */}
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          
          {/* Protected Routes */}
          <Route path="/cart" element={
            <ProtectedRoute>
              <Cart />
            </ProtectedRoute>
          } />
          <Route path="/orders" element={
            <ProtectedRoute>
              <OrderHistory />
            </ProtectedRoute>
          } />
          <Route path="/orders/track/:orderId" element={
            <ProtectedRoute>
              <OrderTracking />
            </ProtectedRoute>
          } />
          <Route path="/payment" element={
            <ProtectedRoute>
              <PaymentGateway />
            </ProtectedRoute>
          } />
          <Route path="/profile" element={
            <ProtectedRoute>
              <Profile />
            </ProtectedRoute>
          } />
          
          {/* Admin Routes */}
          <Route path="/admin" element={
            <ProtectedRoute>
              <Dashboard />
            </ProtectedRoute>
          } />
          
          {/* 404 Page */}
          <Route path="*" element={
            <div className="min-h-screen flex items-center justify-center bg-gray-50">
              <div className="text-center">
                <h1 className="text-6xl font-bold text-orange-500 mb-4">404</h1>
                <p className="text-xl text-gray-600 mb-8">Page not found</p>
                <a 
                  href="/" 
                  className="px-6 py-3 bg-orange-500 text-white rounded-lg hover:bg-orange-600 transition-colors"
                >
                  Go Home
                </a>
              </div>
            </div>
          } />
        </Routes>
      </main>
      
      {showLayout && <Footer />}
    </div>
  );
};

const App = () => {
  return (
    <Router>
      <NotificationProvider>
        <AuthProvider>
          <ProductProvider>
            <CartProvider>
              <OrderProvider>
                <AppContent />
              </OrderProvider>
            </CartProvider>
          </ProductProvider>
        </AuthProvider>
      </NotificationProvider>
    </Router>
  );
};

export default App;
